import React from "react";

const Login = () => {
  return (
    <section id="login">
      <h2>Login</h2>
      <form>
        <input type="email" placeholder="Email" required /><br /><br />
        <input type="password" placeholder="Password" required /><br /><br />
        <button type="submit">Login</button>
      </form>
    </section>
  );
};

export default Login;
